// Header.js
import React from 'react';
import '../styles/Header.css';
import logo from '../logo.jpg';
import { Link, useLocation } from 'react-router-dom';


const Navordi = () => {
    const location = useLocation();

  const isActive = (pathname) => {
    return location.pathname === pathname ? 'active' : '';
  };
  return (
    <div className='header'>
        <div className="header_ordi">
            <img className="logo" src={logo} alt="logo" />
            <Link to="/accueila" className={` ${isActive('/accueila')}`}>
            <div>Accueil</div>
            </Link>
            <Link to="/chantier" className={` ${isActive('/chantier')}`}>
            <div>Chantier</div>
            </Link>
            <Link to="/materiel" className={` ${isActive('/materiel')}`}>
            <div>Matériel</div>
            </Link>
            <Link to="/edt" className={` ${isActive('/edt')}`}>
            <div>Emploi du temps</div>
            </Link>
            <Link to="/materiel" className={` ${isActive('/materiel')}`}>
            <div>Matériel</div>
            </Link>
        </div>
    </div>

  );
};

export default Navordi;
